import React from "react";

const PropsCard = (Props) => {

  let {name,img,rel,lang,hero,budget} =Props
  return (
    <>
      <div>{name}</div>
      <div><img src="" alt="" /></div>
      <div>{rel}</div>
      <div>{lang}</div>
      <div>{hero}</div>
      <div>{budget}</div>
    </>
  );
};

export default PropsCard;
